import React, { useState, useEffect } from "react";
import { Table } from "reactstrap";
import axios from "axios";
import Header from "../component/adminbar";
const master = (props) => {
  const [count, setCount] = useState(0);
  let testValue = 0;
  useEffect(() => {
    for (var i = 0; i < props.data.length; i++) {
      if (props.data[i].id === "") {
        testValue++;
        console.log(props.data[i].id);
        setCount(testValue);
      }
    }

    console.log(count);
  }, []);
  return (
    <div>
      <Header />
      테스트이용한사람:{props.data.length}
      <Table>
        <thead>
          <tr>
            <th>id</th>
            <th>성별</th>
            <th>년</th>
            <th>월</th>
            <th>일</th>
            <th>시간</th>
            <th>이용시간</th>
          </tr>
        </thead>

        <tbody>
          {props.data.map((contents, num) => (
            <>
              <tr>
                <td>{contents.id}</td>
                <td>{contents.gender}</td>
                <td>{contents.year}</td>
                <td>{contents.mon}</td>
                <td>{contents.day}</td>
                <td>{contents.time}</td>
                <td>{contents.subscriptionTime}</td>
              </tr>
            </>
          ))}
        </tbody>
      </Table>
    </div>
  );
};
master.getInitialProps = async function ({ query }) {
  //const url = require("url");
  //console.log(url);
  //  console.log(query.id);
  const res = await axios.get(
    "https://hanstream.gabia.io/6rKA7IKs7ZWc7IKs656M",
    {}
  );
  const data = await res.data;

  console.log(data);

  console.log(`Show data fetched. Count: ${data.length}`);
  return {
    data: data,
  };
};
export default master;
